import React,{useState} from 'react'

import {Login} from "./Registration/Login"
import { SignUp } from './Registration/SignUp'

export const Registration = () => {
  const [isLogin,setIsLogin] = useState(true)
  return isLogin?<Login/>:<SignUp/>


}
